var dns = require('dns'),
    mine = require('./dns');

exports.compare = {
  "stock lookup": function (done) {
    dns.resolve('www.google.com', 'A', function (err, res) {
      if (err) { throw err; }
      done();
    });
  },
  "my lookup": function (done) {
    mine.resolve('www.google.com', 'A', function (err, res) {
      if (err) { throw err; }
      done();
    });
  },
};

require('bench').runMain();
